new PRO to Unlock'=>'Forny PRO for å låse opp','Renew PRO License'=>'Forny PRO-lisens','PRO fields cannot be edited without an active license.'=>'PRO-felt kan ikke redigeres uten en aktiv lisens.','Please activate your ACF PRO license to edit field groups assigned to an ACF Block.'=>'Aktiver ACF PRO-lisensen din for å redigere feltgrupper som er tilordnet en ACF-blokk.','Please activate your ACF PRO license to edit this options page.'=>'Aktiver ACF PRO-lisensen din for å redigere innstillingene på siden.','Returning escaped HTML values is only possible when format_value is also true. The field values have not been returned for security.'=>'Det er bare mulig å returnere escaped HTML-verdier når format_value også er true. Feltverdiene er ikke returnert av sikkerhetshensyn.','Returning an escaped HTML value is only possible when format_value is also true. The field value has not been returned for security.'=>'Det er bare mulig å returnere en escaped HTML-verdi når format_value også er true. Feltverdien er ikke returnert av sikkerhetshensyn.','%1$s ACF now automatically escapes unsafe HTML when rendered by <code>the_field</code> or the ACF shortcode. We\'ve detected the output of some of your fields has been modified by this change, but this may not be a breaking change. %2$s.'=>'%1$s ACF unnslipper nå automatisk usikker HTML når den gjengis av <code>the_field</code> eller ACF-kortkoden. Vi har oppdaget at utdataene til noen av feltene dine har blitt endret av denne endringen, men det er ikke sikkert at dette er en vesentlig endring. %2$s.','Please contact your site administrator or developer for more details.'=>'Ta kontakt med nettstedets administrator eller utvikler for mer informasjon.','Learn&nbsp;more'=>'Lær mer','Hide&nbsp;details'=>'Skjul&nbsp;detaljer','Show&nbsp;details'=>'Vis&nbsp;detaljer','%1$s (%2$s) - rendered via %3$s'=>'%1$s (%2$s) - gjengitt via %3$s','Renew ACF PRO License'=>'Forny ACF PRO-lisens','Renew License'=>'Forny lisens','Manage License'=>'Behandle lisens','\'High\' position not supported in the Block Editor'=>'Posisjonen «høy» støttes ikke i blokkredigeringen','Upgrade to ACF PRO'=>'Oppgrader til ACF PRO','ACF <a href="%s" target="_blank">options pages</a> are custom admin pages for managing global settings via fields. You can create multiple pages and sub-pages.'=>'<a href="%s" target="_blank">ACF-alternativsider</a> er egendefinerte administrasjonssider for å administrere globale innstillinger via felt. Du kan opprette flere sider og undersider.','Add Options Page'=>'Legg til alternativer-siden','In the editor used as the placeholder of the title.'=>'I redigeringsprogrammet brukes den som plassholder for tittelen.','Title Placeholder'=>'Tittelplassholder','4 Months Free'=>'4 måneder gratis','(Duplicated from %s)'=>'(Duplisert fra %s)','Select Options Pages'=>'Velg innstillingssider','Duplicate taxonomy'=>'Dupliser taksonomi','Create taxonomy'=>'Opprett taksonomi','Duplicate post type'=>'Dupliser innleggstype','Create post type'=>'Opprett innleggstype','Link field groups'=>'Koble sammen feltgrupper','Add fields'=>'Legg til felt','This Field'=>'Dette feltet','ACF PRO'=>'ACF PRO','Feedback'=>'Tilbakemelding','Support'=>'Brukerstøtte','is developed and maintained by'=>'er utviklet og vedlikeholdes av','Add this %s to the location rules of the selected field groups.'=>'Legg til innleggstypen/taksonomien %s i plasseringsreglene for de valgte feltgruppene.','Enabling the bidirectional setting allows you to update a value in the target fields for each value selected for this field, adding or removing the Post ID, Taxonomy ID or User ID of the item being updated. For more information, please read the <a href="%s" target="_blank">documentation</a>.'=>'Hvis du aktiverer toveis-innstillingen, kan du oppdatere en verdi i målfeltene for hver verdi som er valgt for dette feltet, og legge til eller fjerne innleggs-ID, taksonomi-ID eller bruker-ID for elementet som oppdateres. Hvis du vil ha mer informasjon, kan du lese <a href="%s" target="_blank">dokumentasjonen</a>.','Select field(s) to store the reference back to the item being updated. You may select this field. Target fields must be compatible with where this field is being displayed. For example, if this field is displayed on a Taxonomy, your target field should be of type Taxonomy'=>'Velg felt(er) for å lagre referansen tilbake til elementet som oppdateres. Du kan velge dette feltet. Målfeltene må være kompatible med hvor dette feltet vises. Hvis dette feltet for eksempel vises i en taksonomi, bør målfeltet være av typen taksonomi','Target Field'=>'Målfelt','Update a field on the selected values, referencing back to this ID'=>'Oppdater et felt på de valgte verdiene, med referanse tilbake til denne ID-en','Bidirectional'=>'Toveis','%s Field'=>'%s-felt','Select Multiple'=>'Velg flere','WP Engine logo'=>'WP Engine-logo','Lower case letters, underscores and dashes only, Max 32 characters.'=>'Kun små bokstaver, understrek og bindestreker, maks. 32 tegn.','The capability name for assigning terms of this taxonomy.'=>'Funksjonsnavnet for tildeling av termer i denne taksonomien.','Assign Terms Capability'=>'Tilordne vilkår-funksjonalitet','The capability name for deleting terms of this taxonomy.'=>'Funksjonsnavnet for sletting av termer i denne taksonomien.','Delete Terms Capability'=>'Mulighet for å slette vilkår','The capability name for editing terms of this taxonomy.'=>'Funksjonsnavnet for redigering av termer i denne taksonomien.','Edit Terms Capability'=>'Mulighet til å redigere begrep','The capability name for managing terms of this taxonomy.'=>'Kapabilitetsnavnet for håndtering av termer i denne taksonomien.','Manage Terms Capability'=>'Administrere vilkårskapasitet','Sets whether posts should be excluded from search results and taxonomy archive pages.'=>'Angir om innlegg skal utelukkes fra søkeresultater og taksonomiarkivsider.','More Tools from WP Engine'=>'Flere verktøy fra WP Engine','Built for those that build with WordPress, by the team at %s'=>'Bygget for de som bygger med WordPress, av teamet på %s','View Pricing & Upgrade'=>'Se priser og oppgrader','Learn More'=>'Les mer','Speed up your workflow and develop better websites with features like ACF Blocks and Options Pages, and sophisticated field types like Repeater, Flexible Content, Clone, and Gallery.'=>'Få raskere arbeidsflyt og utvikle bedre nettsteder med funksjoner som ACF-blokker og innstilling-sider, og sofistikerte felttyper som Repeater, Flexible Content, Clone og Gallery.','Unlock Advanced Features and Build Even More with ACF PRO'=>'Lås opp avanserte funksjoner og bygg enda mer med ACF PRO','%s fields'=>'%s felt','No terms'=>'Ingen vilkår','No post types'=>'Ingen innleggstyper','No posts'=>'Ingen innlegg','No taxonomies'=>'Ingen taksonomier','No field groups'=>'Ingen feltgrupper','No fields'=>'Ingen felter','No description'=>'Ingen beskrivelse','Any post status'=>'Enhver innleggsstatus','This taxonomy key is already in use by another taxonomy registered outside of ACF and cannot be used.'=>'Denne taksonominøkkelen er allerede i bruk av en annen taksonomi som er registrert utenfor ACF, og kan ikke brukes.','This taxonomy key is already in use by another taxonomy in ACF and cannot be used.'=>'Denne taksonominøkkelen er allerede i bruk av en annen taksonomi i ACF og kan ikke brukes.','The taxonomy key must only contain lower case alphanumeric characters, underscores or dashes.'=>'Taksonominøkkelen må bare inneholde små alfanumeriske tegn, understrek eller bindestreker.','The taxonomy key must be under 32 characters.'=>'Taksonominøkkelen må bestå av mindre enn 32 tegn.','No Taxonomies found in Trash'=>'Ingen taksonomier funnet i papirkurven','No Taxonomies found'=>'Ingen taksonomier funnet','Search Taxonomies'=>'Søk i taksonomier','View Taxonomy'=>'Vis taksonomi','New Taxonomy'=>'Ny taksonomi','Edit Taxonomy'=>'Rediger taksonomi','Add New Taxonomy'=>'Legg til ny taksonomi','No Post Types found in Trash'=>'Ingen innleggstyper funnet i papirkurven','No Post Types found'=>'Ingen innleggstyper funnet','Search Post Types'=>'Søk etter innleggstyper','View Post Type'=>'Vis egendefinert innlegg','New Post Type'=>'Ny innleggstype','Edit Post Type'=>'Rediger innleggstype','Add New Post Type'=>'Legg til ny innleggstype','This post type key is already in use by another post type registered outside of ACF and cannot be used.'=>'Denne posttypenøkkelen er allerede i bruk av en annen posttype som er registrert utenfor ACF, og kan ikke brukes.','This post type key is already in use by another post type in ACF and cannot be used.'=>'Denne posttypenøkkelen er allerede i bruk av en annen posttype i ACF og kan ikke brukes.','This field must not be a WordPress <a href="%s" target="_blank">reserved term</a>.'=>'Dette feltet må ikke være et <a href="%s" target="_blank">reservert WordPress-uttrykk</a>.','The post type key must only contain lower case alphanumeric characters, underscores or dashes.'=>'Posttypenøkkelen må bare inneholde små alfanumeriske tegn, understrek eller bindestreker.','The post type key must be under 20 characters.'=>'Innleggstypenøkkelen må være under 20 tegn.','We do not recommend using this field in ACF Blocks.'=>'Vi anbefaler ikke å bruke dette feltet i ACF Blocks.','Displays the WordPress WYSIWYG editor as seen in Posts and Pages allowing for a rich text-editing experience that also allows for multimedia content.'=>'Viser WordPress WYSIWYG-redigeringsprogrammet som du ser i Innlegg og Sider, slik at du får en rik tekstredigeringsopplevelse som også gir mulighet for multimedieinnhold.','WYSIWYG Editor'=>'WYSIWYG-editor','Allows the selection of one or more users which can be used to create relationships between data objects.'=>'Gjør det mulig å velge én eller flere brukere som kan brukes til å opprette relasjoner mellom dataobjekter.','A text input specifically designed for storing web addresses.'=>'En tekstinngang som er spesielt utviklet for lagring av nettadresser.','URL'=>'URL','A toggle that allows you to pick a value of 1 or 0 (on or off, true or false, etc). Can be presented as a stylized switch or checkbox.'=>'En bryter som lar deg velge en verdi på 1 eller 0 (på eller av, sant eller usant osv.). Kan presenteres som en stilisert bryter eller avkrysningsboks.','An interactive UI for picking a time. The time format can be customized using the field settings.'=>'Et interaktivt brukergrensesnitt for valg av klokkeslett. Tidsformatet kan tilpasses ved hjelp av feltinnstillingene.','A basic textarea input for storing paragraphs of text.'=>'Et grunnleggende tekstområde for lagring av tekstavsnitt.','A basic text input, useful for storing single string values.'=>'En enkel tekstinngang, nyttig for lagring av enkeltstrengverdier.','Allows the selection of one or more taxonomy terms based on the criteria and options specified in the fields settings.'=>'Gjør det mulig å velge ett eller flere taksonomibegreper basert på kriteriene og alternativene som er angitt i feltinnstillingene.','Allows you to group fields into tabbed sections in the edit screen. Useful for keeping fields organized and structured.'=>'Gjør det mulig å gruppere felt i faner i redigeringsskjermbildet. Nyttig for å holde feltene organisert og strukturert.','A dropdown list with a selection of choices that you specify.'=>'En nedtrekksliste med et utvalg av valgmuligheter som du angir.','A dual-column interface to select one or more posts, pages, or custom post type items to create a relationship with the item that you\'re currently editing. Includes options to search and filter.'=>'Et grensesnitt med to kolonner der du kan velge ett eller flere innlegg, sider eller egendefinerte innleggstyper for å opprette en relasjon til det aktuelle elementet du redigerer. Inkluderer alternativer for å søke og filtrere.','An input for selecting a numerical value within a specified range using a range slider element.'=>'En inngang for å velge en numerisk verdi innenfor et spesifisert område ved hjelp av et skyveelement.','A group of radio button inputs that allows the user to make a single selection from values that you specify.'=>'En gruppe radioknapper som lar brukeren foreta ett enkelt valg blant verdier du angir.','An interactive and customizable UI for picking one or many posts, pages or post type items with the option to search. '=>'Et interaktivt og tilpassbart brukergrensesnitt for å velge ett eller flere innlegg, sider eller innleggstyper med mulighet for å søke. ','An input for providing a password using a masked field.'=>'En inngang for å angi et passord ved hjelp av et maskert felt.','Filter by Post Status'=>'Filtrer etter innleggsstatus','An interactive dropdown to select one or more posts, pages, custom post type items or archive URLs, with the option to search.'=>'En interaktiv nedtrekksmeny der du kan velge ett eller flere innlegg, sider, egendefinerte innleggstyper eller arkiv-URL-er, med mulighet for å søke.','An interactive component for embedding videos, images, tweets, audio and other content by making use of the native WordPress oEmbed functionality.'=>'En interaktiv komponent for innbygging av videoer, bilder, tweets, lyd og annet innhold ved hjelp av WordPress\' egen oEmbed-funksjonalitet.','An input limited to numerical values.'=>'En inndata begrenset til numeriske verdier.','Used to display a message to editors alongside other fields. Useful for providing additional context or instructions around your fields.'=>'Brukes til å vise en melding til redaktørene sammen med andre felt. Nyttig for å gi ekstra kontekst eller instruksjoner rundt feltene dine.','Allows you to specify a link and its properties such as title and target using the WordPress native link picker.'=>'Lar deg spesifisere en lenke og dens egenskaper, for eksempel tittel og mål, ved hjelp av WordPress\' egen lenkevelger.','Uses the native WordPress media picker to upload, or choose images.'=>'Bruker WordPress\' egen medievelger til å laste opp eller velge bilder.','Provides a way to structure fields into groups to better organize the data and the edit screen.'=>'Gjør det mulig å strukturere feltene i grupper for å organisere dataene og redigeringsskjermbildet på en bedre måte.','An interactive UI for selecting a location using Google Maps. Requires a Google Maps API key and additional configuration to display correctly.'=>'Et interaktivt brukergrensesnitt for å velge et sted ved hjelp av Google Maps. Krever en Google Maps API-nøkkel og ytterligere konfigurasjon for å vises riktig.','Uses the native WordPress media picker to upload, or choose files.'=>'Bruker WordPress\' egen medievelger til å laste opp eller velge filer.','A text input specifically designed for storing email addresses.'=>'En tekstinngang som er spesielt utviklet for lagring av e-postadresser.','An interactive UI for picking a date and time. The date return format can be customized using the field settings.'=>'Et interaktivt brukergrensesnitt for valg av dato og klokkeslett. Dato-returformatet kan tilpasses ved hjelp av feltinnstillingene.','An interactive UI for picking a date. The date return format can be customized using the field settings.'=>'Et interaktivt brukergrensesnitt for å velge en dato. Dato-returformatet kan tilpasses ved hjelp av feltinnstillingene.','An interactive UI for selecting a color, or specifying a Hex value.'=>'Et interaktivt brukergrensesnitt for å velge en farge eller angi en Hex-verdi.','A group of checkbox inputs that allow the user to select one, or multiple values that you specify.'=>'En gruppe avkrysningsbokser som lar brukeren velge én eller flere verdier som du angir.','A group of buttons with values that you specify, users can choose one option from the values provided.'=>'En gruppe knapper med verdier som du angir, der brukerne kan velge ett alternativ blant de angitte verdiene.','Allows you to group and organize custom fields into collapsable panels that are shown while editing content. Useful for keeping large datasets tidy.'=>'Gjør det mulig å gruppere og organisere egendefinerte felt i sammenleggbare paneler som vises mens du redigerer innhold. Nyttig for å holde orden i store datasett.','This provides a solution for repeating content such as slides, team members, and call-to-action tiles, by acting as a parent to a set of subfields which can be repeated again and again.'=>'Dette gir en løsning for gjentatt innhold, for eksempel lysbilder, teammedlemmer og oppfordringer til handling, ved å fungere som et overordnet felt for et sett med underfelt som kan gjentas om og om igjen.','This provides an interactive interface for managing a collection of attachments. Most settings are similar to the Image field type. Additional settings allow you to specify where new attachments are added in the gallery and the minimum/maximum number of attachments allowed.'=>'Dette gir et interaktivt grensesnitt for håndtering av en samling vedlegg. De fleste innstillingene er de samme som for felttypen Bilde. I tillegg kan du angi hvor nye vedlegg skal legges til i galleriet, og hvor mange vedlegg som er tillatt (minimum/maksimum).','This provides a simple, structured, layout-based editor. The Flexible Content field allows you to define, create and manage content with total control by using layouts and subfields to design the available blocks.'=>'Dette gir en enkel, strukturert og layoutbasert editor. I feltet Fleksibelt innhold kan du definere, opprette og administrere innhold med full kontroll ved hjelp av oppsett og underfelt for å utforme de tilgjengelige blokkene.','This allows you to select and display existing fields. It does not duplicate any fields in the database, but loads and displays the selected fields at run-time. The Clone field can either replace itself with the selected fields or display the selected fields as a group of subfields.'=>'Med denne funksjonen kan du velge og vise eksisterende felt. Den dupliserer ingen felt i databasen, men laster inn og viser de valgte feltene i kjøretiden